  font-size: 100px;
  color: pink;
`;

const Home = () => {
  return (
    <>
      <Head>
        <title>Create Next App</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <Heading1>HELLO</Heading1>
    </>
  );
};

export default Home;
